import React from "react";

const AddMovie = () => {
  return (
    <form className="p-2" action="">
      <div className="form-group">
        <input
          type="text"
          class="form-control"
          placeholder="Enter movie name"
        ></input>
      </div>
    </form>
  );
};

export default AddMovie;
